.content {
    background: #ffffff;
    .container {
        display:flex ;
        padding-top: 23px;
        padding-bottom: 23px;
        position: relative;
        .null {
            margin-left: 433px;
        }
        .navigation {
            display: flex;
            justify-content: space-between;
            ul {
                display:flex ;
                list-style-type: none;
                li {
                    padding-right: 40px;
                    
                    a {
                        text-decoration: none;
                        font-family: 'Gilroy';
                        font-style: normal;
                        font-weight: 600;
                        font-size: 14px;
                        color: #373A46;
                    }
                }
            }
            svg {
                margin-right: 40px;
            }
            .user_card {
                display: flex;
                p {
                    font-family: 'Gilroy';
                    font-style: normal;
                    font-weight: 600;
                    font-size: 14px;
                    line-height: 110%;
                    color: #2B4BFB;
                    padding-right: 16px;
                }
                img {
                    position: absolute;
                    top: 10px;
                    right: 32px;
                }
                svg {
                    position: absolute;
                    top: 25px;
                    right: -30px;
                }
            }
        }
    }
    
}
.color_container {
    background: #F5F5F5;
    .content {
        background: #F5F5F5;
        padding-top: 25px;
        padding-bottom: 24px;
        .back {
            display: flex;
            justify-content: space-between;
            p {
                font-family: 'Gilroy';
                font-style: normal;
                font-weight: 500;
                font-size: 12px;
                line-height: 14px;
                color: #717171;
        
            }
            a {
                text-decoration: none;
                font-family: 'Gilroy';
                font-style: normal;
                font-weight: 500;
                font-size: 14px;
                line-height: 16px;
                color: #2B4BFB;
            }
        }
    }
   
}
